import Navbar from "./Navbar";

const Admin = () => {
  return (
    <>
      <div className="min-h-screen bg-gray-100 text-gray-900">
      <main className="max-w-5xl mx-auto px-4 sm:px-6 lg:px-8 pt-4">
        <div className="">
          <Navbar />
        </div>
        <div className="mt-6">
        </div>
      </main>
    </div>
    </>
  );
};

export default Admin;
